DROP TABLE IF EXISTS `planta`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `planta` (
  `id_planta` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Identificador de la planta',
  `nombre_ptar` varchar(50) NOT NULL COMMENT 'Nombre',
  `estado_id` int(11) DEFAULT NULL,
  `municipio_id` int(11) DEFAULT NULL,
  `coord_latitud` double DEFAULT NULL,
  `coord_longitud` double DEFAULT NULL,
  `calle` varchar(50) DEFAULT NULL,
  `numero` varchar(20) DEFAULT NULL,
  `colonia` varchar(50) DEFAULT NULL,
  `cp` varchar(10) DEFAULT NULL,
  `superficie` float DEFAULT NULL,
  `caudal_entrada` float DEFAULT NULL,
  `influente_industrial` float DEFAULT NULL,
  `fecha_inicio_const` varchar(20) DEFAULT NULL,
  `fecha_fin_const` varchar(20) DEFAULT NULL,
  `fecha_inicio_oper` varchar(20) DEFAULT NULL,
  `poblacion_beneficiada` int(11) DEFAULT NULL,
  `anio_actual` varchar(20) DEFAULT NULL,
  `tipo_tratamiento` varchar(200) DEFAULT NULL,
  `gasto_diseño` float DEFAULT NULL,
  `gasto_operacion_estiaje` float DEFAULT NULL,
  `gasto_operacion_lluvia` float DEFAULT NULL,
  `ro_nombre_institucion` varchar(200) DEFAULT NULL,
  `ro_nombre` varchar(200) DEFAULT NULL,
  `ro_puesto` varchar(100) DEFAULT NULL,
  `ro_correo` varchar(100) DEFAULT NULL,
  `ro_telefono` varchar(40) DEFAULT NULL,
  `doc_diagnostico` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id_planta`) USING BTREE,
  KEY `fk_estado_id` (`estado_id`),
  KEY `fk_municipio_id` (`municipio_id`),
  CONSTRAINT `fk_estado_id` FOREIGN KEY (`estado_id`) REFERENCES `estado` (`id_estado`),
  CONSTRAINT `fk_municipio_id` FOREIGN KEY (`municipio_id`) REFERENCES `municipio` (`id_municipio`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=COMPACT;
/*!40101 SET character_set_client = @saved_cs_client */;

